import Layout from '../components/Layout';

export default ({ statusCode }) => (
  <Layout title="error">
    <h1>404</h1>
    {statusCode
      ? `Could not load your user data: Status code ${statusCode}`
      : ''}
    <p>Couldn't get that page, sorry</p>
  </Layout>
);
